import ProductsData from "./Data/Productos"
import Cards from './Components/Cards/Cards';
import './App.css';



function App() {

return (

  <div className="App">


   {ProductsData.map( products => (

     <Cards 
     img={products.img} 
     key={products.id} 
     name={products.name} 
     price={products.price}
     ammount={products.ammount} 
     descripcion={" "} /> 

     ))}






</div>
)}

export default App;
